import React, { useEffect } from 'react';

import ProjectComponents from './projectComponents'

import {Link} from "react-router-dom";


const AllProjects =({id}) => {






    let allprojectslist=[
        {
            "intro":"Project 14",
            "title":"Simon Says Crypto - Cryptocurrency Learning Community (WP)", "content":"Educational platform community for the cryptocurrency industury, taught by an individual instructor offering an online course in cryptocurrency, users can register and login to buy the course and only then they can watch it.",
            "btnclass":"readMore",
            "btn":"Read More",
            "icon":true,
            "pId":"p1",
            "flip":true,
            "link":"https://simonsayscrypto.co.il",
            "more":"https://simonsayscrypto.co.il",
            "cat":"Wordpress",
            "float":"Left"
        },
        {
            "intro":"Project 13",
            "title":"Done Pro - Concrete Contractor Services (WP)",
            "content":"Done pro is Providing concrete sawing and drilling services through innovative technology and safety equipment for all types of buildings, opening doors, windows, enlarging openings, demolishing buildings and more.",
            "btnclass":"readMore",
            "btn":"Read More",
            "icon":true,
            "pId":"p2",
            "link":"https://donepro.co.il",
            "more":"https://donepro.co.il",
            "cat":"Wordpress",
       "float":"Right"

}
    ];

    const handleShowStripe = () => (

        allprojectslist.map((skill)=>(


            <ProjectComponents

float={skill.float}
                title={skill.title}
id={skill.pId}
content={skill.content}
more={skill.more}
btn={skill.btn}



            >


            </ProjectComponents





            >

        )));

    return(
        <div className="highlight_wrapper">

       <h1 className="projects-section__Heading-sc-1r8qvbm-1 piqbM"><span
                className="SplashText__SplashTextStyles-sc-17ii5cd-0 onayw">Projects</span></h1>
            <div className="projects" > {handleShowStripe()}
                <div className="viewal" style={{ display: 'flex', justifyContent: 'center', marginTop: '50px' }}>
                    <Link to="/portfolio"> <button className= "vll" style={vAllBtn}>View All</button></Link>
                </div>
            </div>


        </div>


    )
}
const vAllBtn = {
    marginRight: '400px',
    width:'120px',
    height:'45px',
    border:'none',
    borderRadius:'10px',
    cursor:'pointer',
    color:'grey'
}


export default AllProjects;
